script: |
  super -f text -I q11711.spq | sort > q11711.out

inputs:
  - name: q11711.spq
    data: |
      SELECT col1 * ( - 53 ) AS col0 FROM tab2 (FORMAT parquet) WHERE NOT ( - ( + 80 ) * col2 ) BETWEEN ( + col1 * + col1 ) AND + 29;
  - name: tab2

outputs:
  - name: q11711.out
    data: |
      -2703
      -3551
      -4081
